import { createTheme } from '@mui/material/styles';

const theme = createTheme({
  palette: {
    primary: {
      main: '#FB37A3',
    },
    secondary: {
      main: '#FD9DD1',
    },
    info: {
        main: '#FFFFFF'
    }
  },

  components: {
    MuiMenu: {
      styleOverrides: {
        root: {
          backgroundColor: '#FD9DD1',
        },
      },
    },
  },
  

});

export default theme;
